import React from 'react';
import './LibrarianDashboard.css';

const LibrarianDashboard = () => {
    const handleLogout = () => {
        window.location.href = '/login'; // Redirect to login page
        console.log('Logging out...');
    };

    return (
        <div className="librarian-main-content">
            <div className="librarian-header">
                <h1>Welcome, Librarian</h1>
                <button className="librarian-logout-button" onClick={handleLogout}>Logout</button>
            </div>

            <div className="librarian-section">
                <h2>User Assistance</h2>
                <button className="librarian-button">Assist with Renewals</button>
                <button className="librarian-button">View Reservations</button>
            </div>

            <div className="librarian-section">
                <h2>Inventory Management</h2>
                <button className="librarian-button">Track Resources</button>
                <button className="librarian-button">Manage Overdue Items</button>
            </div>
        </div>
    );
};

export default LibrarianDashboard;
